<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Document</title>
</head>

<body>
    <script>
        const styles = getComputedStyle(document.body)
        let result = []

        for (const style of styles) {
            if (!style.match('webkit')) {
                result.push(style)
            }
        }

        console.log(result.join('\n'));
    </script>
</body>

</html>
